import sys

def main():
    input_data = sys.stdin.read().split()
    if not input_data:
        return
    iterator = iter(input_data)
    K = int(next(iterator))
    G = int(next(iterator))
    M = int(next(iterator))

    glass = 0
    mug = 0

    for _ in range(K):
        if glass == G:
            glass = 0
        elif mug == 0:
            mug = M
        else:
            transfer = min(mug, G - glass)
            glass += transfer
            mug -= transfer

    print(f"{glass} {mug}")

