import sys

MOD = 10**9 + 7

def main():
    input_data = sys.stdin.read().split()
    if not input_data:
        print(0)
        return
    iterator = iter(input_data)
    nums = []
    while True:
        try:
            num = int(next(iterator))
            nums.append(num)
        except StopIteration:
            break
    ones = [i for i, x in enumerate(nums) if x == 1]
    m = len(ones)
    if m < 1:
        print(0)
    elif m == 1:
        print(1)
    else:
        res = 1
        for i in range(1, m):
            res = (res * (ones[i] - ones[i-1])) % MOD
        print(res)

if __name__ == '__main__':
    main()

import sys

def main():
    input_data = sys.stdin.read().split()
    N = int(input_data[0])

    x = 1
    while True:
        cube = x ** 3
        if cube > N:
            break
        x += 1

    max_x = x - 1

    for x in range(max_x, 0, -1):
        cube = x ** 3
        s = str(cube)
        if s == s[::-1]:
            print(cube)
            return

    print(1)

if __name__ == "__main__":
    main()

import sys
from collections import Counter

def main():
    input_data = sys.stdin.read().split()
    if not input_data:
        print(-1)
        return

    nums = list(map(int, input_data))
    freq = Counter(nums)
    total_ops = 0

    for f in freq.values():
        if f == 1:
            print(-1)
            return
        if f % 3 == 0:
            total_ops += f // 3
        elif f % 3 == 1:
            total_ops += (f // 3 - 1) + 2
        else:  # f % 3 == 2
            total_ops += (f // 3) + 1

    print(total_ops)

if __name__ == '__main__':
    main()

import sys

def main():
    input_data = sys.stdin.read().split()
    if not input_data:
        return
    iterator = iter(input_data)
    n = int(next(iterator))
    rectangles = []
    for _ in range(n):
        a = int(next(iterator))
        b = int(next(iterator))
        c = int(next(iterator))
        d = int(next(iterator))
        rectangles.append((a, b, c, d))

    total_area = 0
    for a in range(100):
        for b in range(100):
            for (A, B, C, D) in rectangles:
                if A < a + 1 and B > a and C < b + 1 and D > b:
                    total_area += 1
                    break  # No need to check other rectangles once one overlaps
    print(total_area)

if __name__ == '__main__':
    main()

import sys

def main():
    input_data = sys.stdin.read().split()
    if not input_data:
        return
    iterator = iter(input_data)
    n = int(next(iterator))
    matrix = []
    for _ in range(n):
        row = [int(next(iterator)) for _ in range(n)]
        matrix.append(row)
    for i in range(1, n + 1):
        neighbors = []
        for j in range(n):
            if matrix[i - 1][j] == 1:
                neighbors.append(j + 1)
        neighbors.sort()
        print(' '.join(map(str, neighbors)))

if __name__ == '__main__':
    main()

