import sys

def main():
    input_data = sys.stdin.read().split()
    if not input_data:
        return
    iterator = iter(input_data)
    M = int(next(iterator))
    D = []
    for _ in range(M):
        D.append(int(next(iterator)))
    total_days = sum(D)
    middle = (total_days + 1) // 2
    current_sum = 0
    for i in range(M):
        if current_sum + D[i] >= middle:
            a = i + 1
            b = middle - current_sum
            print(f"{a} {b}")
            break
        else:
            current_sum += D[i]

if __name__ == '__main__':
    main()
